import React from 'react'
import Club from '../components/Club'
import ContactUs from '../components/ContactUs'

const Homepage = () => {
  return (
    <div>

    <Club/>
    <hr className="text-red-500 p-2"></hr>
    <ContactUs/>
    </div>
  )
}

export default Homepage
